import React from 'react';
import { AppBar, Toolbar, Typography, Box } from '@mui/material';
import { Link } from 'react-router-dom';
import { styled } from '@mui/material/styles';

interface StyledAppBarProps {
  position: 'fixed' | 'absolute' | 'sticky' | 'static' | 'relative';
}

const StyledAppBar = styled(AppBar)<StyledAppBarProps>(({ theme }) => ({
  backgroundColor: '#566542',
}));

const StyledLink = styled(Link)(({ theme }) => ({
  color: 'white',
  margin: '0 10px',
  textDecoration: 'none',
  padding: '8px 16px',
  borderRadius: '4px',
  '&:hover': {
    backgroundColor: '#1B5E20',
  },
}));

const Navbar: React.FC = () => {
  return (
    <StyledAppBar position="fixed">
      <Toolbar>
        <Typography 
          variant="h6" 
          component={Link} 
          to="/" 
          sx={{ 
            flexGrow: 1, 
            textDecoration: 'none', 
            color: 'white',
            fontWeight: 'bold'
          }}
        >
          PsicoCris
        </Typography>
        <Box>
          <StyledLink to="/">
            In√≠cio
          </StyledLink>
          <StyledLink to="/terapia-individual">
            Terapia Individual
          </StyledLink>
          <StyledLink to="/terapia-jovens">
            Terapia para Jovens
          </StyledLink>
          <StyledLink to="/psicologia-infantil">
            Psicologia Infantil
          </StyledLink>
        </Box>
      </Toolbar>
    </StyledAppBar>
  );
};

export default Navbar;
